import{_ as a,c as e,o as i,a5 as t}from"./chunks/framework.DwbewbAn.js";const b=JSON.parse('{"title":"CUP","description":"","frontmatter":{},"headers":[],"relativePath":"computer/计算机硬件/2-CPU.md","filePath":"computer/计算机硬件/2-CPU.md","lastUpdated":1705827463000}'),l={name:"computer/计算机硬件/2-CPU.md"},r=t('<h1 id="cup" tabindex="-1">CUP <a class="header-anchor" href="#cup" aria-label="Permalink to &quot;CUP&quot;">​</a></h1><p><a href="https://topic.expreview.com/CPU/" target="_blank" rel="noreferrer">超能网CPU天梯图</a></p><p><a href="https://www.mydrivers.com/zhuanti/tianti/cpu/" target="_blank" rel="noreferrer">快科技桌面CPU天梯图</a></p><p><a href="https://tieba.baidu.com/p/5005825360" target="_blank" rel="noreferrer">秋刀鱼半藏cpu天梯图</a></p><h2 id="核心和线程" tabindex="-1">核心和线程 <a class="header-anchor" href="#核心和线程" aria-label="Permalink to &quot;核心和线程&quot;">​</a></h2><p>物理核心数: 等于干活的人数, 越多越快.</p><p>线程数: 等于流水线, 一个人做多条流水线, 增加百分之 20% 的效率.</p><p><img src="https://img.xbin.cn/images/2023/07/28-13-34-580643.png" alt=""></p><p>比如 i7 10700k 8 核心 16 线程, 就等于 1 个物理核心管理 2 个线程.</p><h2 id="频率" tabindex="-1">频率 <a class="header-anchor" href="#频率" aria-label="Permalink to &quot;频率&quot;">​</a></h2><blockquote><p>频率分为: 基础频率和加速频率</p></blockquote><p>比如 i7 10700k 8 核心 16 线程的频率是:</p><ul><li>基础频率(普通的干活速度): 3.8GHZ</li><li>加速频率(加钱了的干活速度): 5.1GHZ</li></ul><h2 id="ipc性能" tabindex="-1">IPC性能 <a class="header-anchor" href="#ipc性能" aria-label="Permalink to &quot;IPC性能&quot;">​</a></h2><blockquote><p>IPC 就是 CPU 的效率</p></blockquote><p><img src="https://img.xbin.cn/images/2023/07/28-13-56-5a1584.png" alt=""></p><p>有时候频率高线程一样的情况下 IPC 架构好的吊打高频率</p><h2 id="cpu后缀" tabindex="-1">CPU后缀 <a class="header-anchor" href="#cpu后缀" aria-label="Permalink to &quot;CPU后缀&quot;">​</a></h2><p>台式机:</p><ul><li>后缀+X至高性能处理器；</li><li>后缀+F代表不带集显处理器；</li><li>后缀+E代表嵌入式工程级处理器；</li><li>后缀+s代表低电压处理器；</li><li>后缀+K代表不锁倍频处理器；</li><li>后缀+T代表超低电压处理器；</li><li>后缀+P代表屏蔽集显处理器；</li></ul><p>笔记本:</p><ul><li>后缀+M代表标准电压处理器；</li><li>后缀+U代表低电压处理器；</li><li>后缀+H高电压且不可拆卸处理器；</li><li>后缀+X代表高性能处理器；</li><li>后缀+Q代表4核心至高性能处理器；</li><li>后缀+Y代表超低电压处理器。</li></ul><p>俩个字母一起带就是同时包含这俩种的意思</p><h2 id="cup选择" tabindex="-1">CUP选择 <a class="header-anchor" href="#cup选择" aria-label="Permalink to &quot;CUP选择&quot;">​</a></h2><blockquote><p>不拖显卡后退就行</p></blockquote><h3 id="游戏玩家" tabindex="-1">游戏玩家 <a class="header-anchor" href="#游戏玩家" aria-label="Permalink to &quot;游戏玩家&quot;">​</a></h3><p><img src="https://img.xbin.cn/images/2023/07/28-14-02-5bfb42.png" alt=""></p><h3 id="专业软件" tabindex="-1">专业软件 <a class="header-anchor" href="#专业软件" aria-label="Permalink to &quot;专业软件&quot;">​</a></h3><p><img src="https://img.xbin.cn/images/2023/07/28-14-06-15c2ab.png" alt=""></p><p><img src="https://img.xbin.cn/images/2023/07/28-14-06-764ca7.png" alt=""></p><p><img src="https://img.xbin.cn/images/2023/07/28-14-06-d4cd0f.png" alt=""></p><p><img src="https://img.xbin.cn/images/2023/07/28-14-06-3ef00e.png" alt=""></p>',32),p=[r];function o(c,n,s,h,u,m){return i(),e("div",null,p)}const g=a(l,[["render",o]]);export{b as __pageData,g as default};
